However, you can use a workaround to simulate a background color change by using a combination of elements within the Adaptive Card. Here's an example of how you can achieve this:

1. **Use a Container with a Style**: You can use a container with the `emphasis` or `accent` style to change the background color of a section within the card.

2. **Use Images**: You can use an image with the desired background color as a workaround.

Here's an example of how you can use a container with the `emphasis` style:

```json
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "Container",
      "style": "emphasis",
      "items": [
        {
          "type": "TextBlock",
          "size": "Medium",
          "weight": "Bolder",
          "text": "This is a text block with emphasis style"
        }
      ]
    }
  ],
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "version": "1.3"
}
```

In this example, the `emphasis` style will change the background color of the container to a different shade, depending on the host application's theme.

