### 1. Loop Unrolling
Loop unrolling reduces the overhead of loop control by duplicating the loop body multiple times.

**Example:**
```c
// Original code
for (int i = 0; i < 10; i++) {
    array[i] = i * 2;
}

// Optimized code with loop unrolling
array[0] = 0 * 2;
array[1] = 1 * 2;
array[2] = 2 * 2;
array[3] = 3 * 2;
array[4] = 4 * 2;
array[5] = 5 * 2;
array[6] = 6 * 2;
array[7] = 7 * 2;
array[8] = 8 * 2;
array[9] = 9 * 2;
```

### 2. Inlining
Inlining replaces function calls with the actual function code to eliminate the overhead of function calls.

**Example:**
```c
// Original code
int add(int a, int b) {
    return a + b;
}

int main() {
    int x = 5, y = 10;
    int result = add(x, y);
    return result;
}

// Optimized code with inlining
int main() {
    int x = 5, y = 10;
    int result = x + y;
    return result;
}
```

### 3. Dead Code Elimination
Dead code elimination removes code that does not affect the program's output.

**Example:**
```c
// Original code
int main() {
